        <label for="da-type">Display ad type:</label>
        </input>
    </div>

  );
  function createJson(){
    const value = {
      name: document.getElementById('name').value
      // typeOfAd: document.getElementById('da-type'),
      // imageResize: document.getElementById('image_resize'),
      // interactions: document.getElementById('interactions'), 
    }
    alert(value.name)

  }
  function sayHello(){
    alert("Hello")
  }
}

export default App;
